import {
  Stack,
  Drawer,
  AppBar,
  Toolbar,
  IconButton,
  MenuIcon
} from "@mui/material";
import DashboardIcon from '@mui/icons-material/Dashboard';
const width=250;
const Admin = ()=>{
  const design = (
    <>
      <Stack>
        <Drawer variant="permanent" sx={{width:`${width}`}}
        >
        </Drawer>
      </Stack>
    </>
  );
  return design;
}
export default Admin;
